SPARQL Query:
PREFIX ns1: <https://enpkg.commons-lab.org/kg/>
  SELECT ?sample ?taxon ?labProcess ?label
  WHERE {
      ?sample ns1:has_wd_id ?taxon .
      ?sample ns1:has_lab_process ?labProcess .
      OPTIONAL { ?sample rdfs:label ?label . }
  }
  ORDER BY ?sample ?labProcess

PREFIX ns1: <https://enpkg.commons-lab.org/kg/>
  PREFIX ns2: <https://enpkg.commons-lab.org/module/>

  SELECT ?InChIkey
  WHERE {
      ?chemicalEntity ns2:has_chembl_id ?chemblChemical .
      ?chemblChemical ns2:has_chembl_activity ?assayResults .
      ?assayResults ns2:target_id <https://www.ebi.ac.uk/chembl/target_report_card/CHEMBL367> ;
                     ns2:activity_type "IC50" ;
                     ns2:activity_value ?activityValue .
      FILTER(?activityValue < 500)
      ?chemicalEntity ns1:has_wd_id ?wd_id .
 ?InChIkey ns1:has_wd_id ?wd_id .
  }

PREFIX ns1: <https://enpkg.commons-lab.org/kg/>
  PREFIX ns2: <https://enpkg.commons-lab.org/module/>

  SELECT ?labExtract
  WHERE {
      ?labExtract ns2:has_bioassay_results ?bioAssayResult .
      ?bioAssayResult ns2:target_id <https://www.ebi.ac.uk/chembl/target_report_card/CHEMBL612348> .
      {
          ?bioAssayResult a ns2:Tbrucei2ugml .
      }
  }

PREFIX ns1: <https://enpkg.commons-lab.org/kg/>

  SELECT ?labExtract
  WHERE {
    ?labExtract ns1:has_LCMS ?analysis.
  ?analysis ns1:has_lcms_feature_list ?featureList .
      ?featureList ns1:has_lcms_feature ?feature .
      {
          SELECT ?labExtract (COUNT(?feature) AS ?featureCount)
          WHERE {
    ?labExtract ns1:has_LCMS ?analysis. 
          ?analysis ns1:has_lcms_feature_list ?featureList .
              ?featureList ns1:has_lcms_feature ?feature .
          }
          GROUP BY ?labExtract
          HAVING (?featureCount > 2000)
      }
  }

PREFIX ns1: <https://enpkg.commons-lab.org/kg/>

  SELECT (COUNT(DISTINCT ?InChIkey2D) AS ?uniqueInChIkey2DCount)
  WHERE {
      ?annotation ns1:has_InChIkey2D ?InChIkey2D .
  }

PREFIX ns1: <https://enpkg.commons-lab.org/kg/>
PREFIX ns2: <https://enpkg.commons-lab.org/module/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT ?posFeature ?negFeature
WHERE {
    ?rawMaterial ns1:has_wd_id <http://www.wikidata.org/entity/Q6813281> ;
                 ns1:has_lab_process ?labExtract .
    ?labExtract ns1:has_LCMS ?posAnalysis, ?negAnalysis .
    ?posAnalysis a ns1:LCMSAnalysisPos ;
                 ns1:has_lcms_feature_list ?posFeatureList .
    ?negAnalysis a ns1:LCMSAnalysisNeg ;
                 ns1:has_lcms_feature_list ?negFeatureList .
    ?posFeatureList ns1:has_lcms_feature ?posFeature .
    ?negFeatureList ns1:has_lcms_feature ?negFeature .
    ?posFeature ns1:has_sirius_annotation ?posAnnotation ;
                ns1:has_retention_time ?posRT ;
                ns1:has_parent_mass ?posMass .
    ?negFeature ns1:has_sirius_annotation ?negAnnotation ;
                ns1:has_retention_time ?negRT ;
                ns1:has_parent_mass ?negMass .
    ?posAnnotation ns1:has_sirius_adduct "[M+H]+" .
    ?negAnnotation ns1:has_sirius_adduct "[M-H]-" .
    FILTER (ABS(?posRT - ?negRT) <= 3)
    FILTER (ABS(?posMass - ?negMass) / ?posMass <= 0.000005)
}

PREFIX ns1: <https://enpkg.commons-lab.org/kg/>
PREFIX ns2: <https://enpkg.commons-lab.org/module/>

SELECT ?labExtract
WHERE {
    ?labExtract ns2:has_bioassay_results ?bioAssayResult .
    ?bioAssayResult ns2:inhibition_percentage ?inhibitionPercentage ;
                    ns2:target_id <https://www.ebi.ac.uk/chembl/target_report_card/CHEMBL367> .
  ?bioAssayResult a ns2:Ldono10ugml.
  FILTER(?inhibitionPercentage > 50)
}
